import React from 'react';
import './Dashboard.css';

const Dashboard = () => {
  return (
    <div className="dashboard-container">
      <h1>DashBoard</h1>
      <div className="welcome-message">
        <h2>Welcome Admin Panel</h2>
      </div>
    </div>
  );
};

export default Dashboard;
